import React, { useState } from "react";

import "./assets/css/main.css";
import Axios from 'axios'


export default function LoginPage({ navigation }) {
	const session = localStorage.getItem('session')
	const noteslist = localStorage.getItem('noteslist')
	localStorage.getItem('session', JSON.stringify(session))
	localStorage.getItem('noteslist', JSON.stringify(noteslist))

	const reg = {
		session: session,
		noteslist: noteslist,
	}

	const handleSubmit = () => {
		Axios.post("http://localhost:19007/notestable", reg)
		console.log(reg)
		navigation.navigate('LoginPage')
	}

  return (
	<View>
		<View>
		<View style={styles.middle}>
				<Text style={styles.title}>Вітаємо!</Text>
			</View>
			<Image source={require("./images/success.png")} style={{
					width: '68%', marginLeft: '16%', height: '68%'
				}} />
			<View style={styles.middle}>
				<Text style={styles.title2}>Реєстрація завершена</Text>
			</View>

			<form action="" onSubmit={handleSubmit}>
				<View style={styles.spaceBtn}>
					<View style={styles.btn}>
						<View style={styles.middleBtn}>
							<View style={styles.middleBtn} onClick={handleSubmit}>
								<Text style={styles.textBtn}>Старт</Text>
							</View>
						</View>
					</View>
				</View>
			</form>
		</View>
	</View>
  )
}

const styles = StyleSheet.create({
	middle: {
		alignItems: 'center',
	},
	title: {
		fontWeight: 600,
		fontSize: 40,
		marginTop: "37%",
		marginBottom: "5%",
	},
	title2: {
		fontSize: 30,
		marginTop: "4.8%",
		marginBottom: "3.1%",
	},
	spaceBtn: {
		marginTop: 10,
		backgroundColor: '#f2f2f2',
		alignItems: 'center',
	},
	btn: {
		width: 260,
		height: 60,
		borderRadius: 35,
		backgroundColor: '#5c358f',
		alignItems: 'center',
	},
	middleBtn: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		justifyContent: 'space-between',
		height: 60,
	},
	textBtn: {
		fontSize: 25,
		fontWeight: 500,
		color: 'white',
		paddingRight: 8,
		paddingLeft: 8,
		paddingBottom: 5,
	},
});
